import React from "react";
import './CssForAll.css';
import './News.css'



function News(events){
    return(
        <div>
            <div>
                <h1>NEWS</h1>
                {toArray(this.state.events.map((event) => (
              <EventCard 
                id={events.id}
                date={events.creation_date}
                article={events.article}
                title={event.title}
              />
          )))}
            </div>
        </div>
    )
};

export default News ;
